import {React} from "react";
import {Accordion, AccordionDetails, AccordionSummary, Typography} from "@mui/material";
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import './LinkPicker.css'
import routes from "../data/links.json"

export function LinkPicker() {
    let lines = {};
    Object.keys(routes).map((t) => lines[t] = Object.keys(routes[t]));

    return (
        <div class="mainDiv">
            <h2 class="header">Link picker</h2>
            <div style={{width: `700px`}}>
                {
                    Object.keys(lines).map((line) => (
                        <Accordion style={{backgroundColor: "lightgray", marginTop: 10}}>
                            <AccordionSummary
                                expandIcon={<ExpandMoreIcon />}
                                aria-controls="panel1a-content"
                                id="panel1a-header"
                            >
                                <Typography style={ { textTransform: "capitalize" } }>{line}</Typography>
                            </AccordionSummary>
                            <AccordionDetails style={ { maxHeight: "300px", overflowY: "auto" } }>
                                <div><input type={"checkbox"}/> Select All</div> <br/>
                                <div class="row">
                                    {
                                        Object.values(lines[line]).map((l) => (
                                            <div className="column">{l} <input type={"checkbox"}/></div>
                                        ))
                                    }
                                </div>
                            </AccordionDetails>
                        </Accordion>
                    ))
                }
            </div>
        </div>
    );


}
